const handleApiLoaded = (map, maps) => {
    const triangleCoords = [
      { lat: 51.509865, lng: -2.19 },
      { lat: 35.466, lng: -8.118 },
      { lat: 45.321, lng: -6.757 },
      { lat: 89.509865, lng: -2.19 },
    ];
  
     const bermudaTriangle = new maps.Polygon({
      paths: triangleCoords,
      strokeColor: '#FF0000',
      strokeOpacity: 0.8,
      strokeWeight: 2,
      fillColor: '#FF0000',
      fillOpacity: 0.35,
    });
    bermudaTriangle.setMap(map);
  };

module.exports = handleApiLoaded;

